import React, { Component } from 'react'
import Heading from '../shared/heading';
import styled from 'styled-components';


 class index extends Component {
    render() {
        return (
            <div>
                <Heading title="Portfolio" color="#2c3e50" />
                
            </div>
        )
    }
}


export default index;
